  const classes = useStyles();
  return (
    <div className={classes.root}>
      {/* <Box className={classes.box}> */}
      <Button>Our Recipes</Button>
      <Button>Your Menus</Button>
      {/* </Box> */}
    </div>
  );
}

export default HomePage;
